// import logo from './logo.svg';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import './App.css';
import { AgregarEstudiante, EditarEstudiante, ListaEstudiantes } from './estudiantes';


function App() {
  return (
    <div className="App">
      <h1>CRUD MERN stack</h1>
      <BrowserRouter>
        <Route path='/' element={<ListaEstudiantes />}></Route>
        <Route path='/agregarusuario' element={<AgregarEstudiante />}></Route>
        <Route path='/editarusuario' element={<EditarEstudiante />}></Route>
      </BrowserRouter>




    </div>
  );
}

export default App;
